import React, { Component } from "react";
import Chart from "react-apexcharts";
import {
  Container,
  Box,
  Grid,
  Paper,
  Typography,
} from '@material-ui/core';
import withStyles from '@material-ui/styles';
import TopMenuBar from "../components/TopMenuBar";
import BottomMenuBar from '../components/BottomMenuBar';
import './dashboard.css';
import {Map as LeafletMap, TileLayer, Marker, Popup} from 'react-leaflet';
import NodeTable from './nodeTable';

const styles = theme => ({
  paper: {
    padding: theme.spacing(2),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
  }
});

export default class Dashboard extends Component {
  constructor(props) {
    super(props);

    this.state = {
      options: {
        chart: {
          id: "basic-bar"
        },
        xaxis: {
          categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999]
        }
      },
      series: [
        {
          name: "series-1",
          data: [30, 40, 45, 50, 49, 60, 70, 91]
        }
      ]
    };
  }
  render(){
    const classes = this.props;
    return (
      <>
      <Container>
      <TopMenuBar block pageName="Dashboard" hamburgerMenu={false} closeButtonOnly={false} closeWithPrompt={false} backButton={false}/>
        <Grid container spacing={3}>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
              <Box p={2}>
                <Typography variant="h6" component="h2">Today</Typography>
            <Chart
              options={this.state.options}
              series={this.state.series}
              type="bar"
            />
        </Box>
            </Paper>
          </Grid>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
              <Box p={2}>
                <Typography variant="h6" component="h2">Node status</Typography>

        </Box>
            </Paper>
          </Grid>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
                <Box p={1}>
                  <Chart
                    options={this.state.options}
                    series={this.state.series}
                    type="bar"
                  />
                </Box>
              </Paper>
            </Grid>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
              <Box p={1}>
                <NodeTable />
              </Box>
            </Paper>
          </Grid>
        </Grid>
        <BottomMenuBar slectedIcon={1} block/>
        </Container>
      </>
    );
  }
}
